export default (function(a,b,c,d,e,f,g,h){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:e,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:c,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:c,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:c,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:e,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:f,pageSize:25,pageCount:f,total:5}}},GA7ph0nJj7:{data:{id:1120,attributes:{imdbId:"tt0083951",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMTA5NzczNTU5MjNeQTJeQWpwZ15BbWU4MDE2MTQ3NzYx._V1_SX300.jpg",type:c,ratings:[{Source:"Internet Movie Database",Value:"7.7\u002F10"}],item_lang:{data:{id:1783,attributes:{title:g,plot:"This is an animated movie based on the book by Peter Dickinson. In this movie the realm of magic is being threatened by the realm of logic, so Carolinus, the green wizard decides to shield it for all time. Ommedon, the evil red wizard, stands in his way. Carolinus then calls for a quest that is to be led by a man named Peter Dickinson, who is the first man of both the realms of science and magic. It is Peter's job to defeat Ommedon.",slug:"the-flight-of-dragons"}}},books:{data:[{id:6339,attributes:{title:g,description:"Dragons aren't real ... or are they? This carefully constructed and beautifully illustrated case for the existence of dragons will convince even the skeptics.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=x4rfAAAAMAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:true,published:h,publisher:"HarperCollins Publishers",subtitle:a}},{id:6340,attributes:{title:"Flight of Dragons",description:"Text, four-color illustrations, and line drawings recreate the dragons of ancient myth and legend, showing how they flew, breathed fire, mated, hatched their young, hoarded gold and precious stones, and defended themselves",thumbnail:a,authors:["Outlet",b],firstBook:d,published:"1988-12-01",publisher:"Random House Value Pub",subtitle:a}},{id:6341,attributes:{title:"The Flight of the Dragons",description:"Combining fact with fantasy, science with romance, the author sets out to prove that dragons really did exist. Taking clues to the size and nature of these fantastical beasts of mythology and legend, Peter Dickinson presents a riveting thesis on how so great a creature as the dragon actually managed to fly.",thumbnail:a,authors:["Allan Seale",b],firstBook:d,published:h,publisher:"Harpercollins",subtitle:a}},{id:6342,attributes:{title:"Death of a Unicorn",description:"Praise for Peter Dickinson's mysteries: \"A literary magician controlling an appar-ently inexhaustible supply of effects.\"â€”Penelope Lively For best-selling author Lady Margaret, the past is no longer a pleasant memory. Her first lover's mysterious death and the seeming inevitability of her inheriting the family's stately home are cast in new light by secrets unwillingly revisited. The first in a series of reprints of Peter Dickinson's mysteries, this classic British mystery will win fans currently engrossed in Downton Ab-bey. Peter Dickinson has twice received the Crime Writers' As-sociation's Gold Dagger. He lives in England and is married to the novelist Robin McKinley.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=p08bRuIWF1kC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:d,published:"2013-04-12",publisher:"Small Beer Press",subtitle:a}},{id:6343,attributes:{title:"Fire: Tales of Elemental Spirits",description:"Master storytellers Robin McKinley and Peter Dickinson, the team behind Water: Tales of Elemental Spirits, collaborate again to create five captivating tales incorporating the element of fire. In McKinley?s ?First Flight,? a boy and his pet foogit unexpectedly take a dangerous ride on a dragon, and her ?Hellhound? stars a mysterious dog as a key player in an eerie graveyard showdown. Dickinson introduces a young man who must defeat the creature threatening his clan in ?Fireworm,? a slave who saves his village with a fiery magic spell in ?Salamander Man,? and a girl whose new friend, the guardian of a mystical bird, is much older than he appears in ?Phoenix.? With time periods ranging from prehistoric to present day, and settings as varied as a graveyard, a medieval marketplace and a dragon academy, these stories are sure to intrigue and delight the authors? longtime fans and newcomers alike.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=Hl2xvndpcR0C&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:["Robin McKinley",b],firstBook:d,published:"2009-10-29",publisher:"Penguin",subtitle:a}}]}}},meta:{}}},prerenderedAt:1681309493158}}("","Peter Dickinson","movie",null,"series",1,"The Flight of Dragons","1979-01-01"))